import React from "react";
import PropTypes from "prop-types";
import { NativeSelect, Select, TextField } from "@mui/material";
import styled from "styled-components";

CreateTask.propTypes = {};

const InputName = styled(TextField)``;

const BtnNewTask = styled.div`
  display: flex;
  justify-content: flex-end;
  gap: 20px;
  padding-top: 30px;
`;
function CreateTask(props) {
  return (
    <div>
      <form>
        <InputName
          label="Name *"
          variant="standard"
          style={{ width: "100%" }}
        />
        <NativeSelect style={{ width: "100%" }}>
          <option value={0}>Common Task</option>
          <option value={1}>Other Task</option>
        </NativeSelect>
        <BtnNewTask>
          <Button variant="outlined" color="error" sx={{ color: "#333333" }}>
            Cancel
          </Button>
          <Button
            type="submit"
            variant="contained"
            color="error"
            sx={{ background: "#f24b50", color: "#333333" }}
          >
            Save
          </Button>
        </BtnNewTask>
      </form>
    </div>
  );
}

export default CreateTask;
